> Wishing all PakGuns Brothers and Guests A very Happy Eid full of Joy, Happiness & Peace. May Allah accept your sacrifices and grant you success in this world and the next. Eid Mubarik ! </b></Center>";s:14:"notice_14_html";s:70:"Wish all PakGuns members and Friends a very blessed EID. Eid Mubarik !";s:14:"notice_15_html";s:173:"<b>\r\nMalware Removal Complete and New Firewall activated to prevent Spam Users. If someone is having trouble accessing our forums please write to abbas @ pakguns . com  </b>";s:13:"notice_1_html";s:397:"If this is your first visit, be sure to\n		check out the <a href="faq.php{sessionurl_q}" target="_blank"><b>FAQ</b></a> by clicking the\n		link above. You may have to <a href="register.php{sessionurl_q}" target="_blank"><b>register</b></a>\n		before you can post: click the register link above to proceed. To start viewing messages,\n		select the forum that you want to visit from the selection below.";s:13:"notice_2_html";s:661:"Welcome to PakGuns! We extend a Very Warm Welcome to all our Visitor Friends. Ours is a close knit community whose goals are to educate our Pakistani Brethren in Gun Safety, Promote Information Exchange and Combine our Knowledge for common benefit. <p>\r\n</p>\r\nThis is a website for Sportsmen by Sportsmen ! Our usage and interest in Firearms is <b> only for sport</b> and self defense use. \r\nOur community is young and growing by the minute. Don''t just look, Join us ! \r\n<p></p><CENTER>\r\n<b>IMPORTANT: <u><color=#FF0000>ALL P.B / AUTO WEAPON DISCUSSIONS ARE PERMANENTLY BANNED AT PAKGUNS !! ONLY BOLT ACTION HUNTING RIFLES ALLOWED!!</u> </b></color><P></CENTER>";s:13:"notice_3_html";s:133:"If you have 200 posts and wish to list an item for sale, please send a copy of your Valid Firearms license to GrandBazaar@PakGuns.com";s:13:"notice_4_html";s:138:"A very warm welcome to our Hunting brethren. \r\n\r\nPakGuns and it''s management strongly condemns poaching. Kindly read and follow our Rules.";s:13:"notice_5_html";s:295:"Welcome to the World Militaries Section:\r\n\r\nHere you can discuss Firearms currently in use by Militaries worldwide. Please keep in mind this is a discussion, interest forum only, any questions regarding Availability will get you banned instantly !\r\n\r\nKeep the discussion mature and to the point.";s:13:"notice_6_html";s:256:"If Pakistani Firearm Dealers of good repute wish to advertise at PakGuns we can provide them a separate thread to list their Inventories and prices online. PakGuns gets approx 100,000 visitors every month. \r\n\r\nFor more information contact Abbas@PakGuns.com";s:13:"notice_7_html";s:143:"<CENTER><b><u>Please keep in mind that PakGuns completely prohibits discussion of Automatic weapons or Semi Automatic rifles.</u> </b></CENTER>";s:13:"notice_8_html";s:371:"<b>Salams, we are not getting any emails from Users with HOTMAIL.COM email addresses. They have blocked our domain in error, please report the error at the following link https://support.microsoft.com/en-us/getsupport?oaspworkflow=start_1.0.0.0&wfname=capsub&productkey=edfsmsbl3&locale=en-us&wa=wsignin1.0&ccsid=635896150757466409\r\n\r\nOur IP is 176.56.61.47 Thanks.  </b>";s:13:"notice_9_html";s:97:"<b><center>Wishing all PakGuns Members and Guests a very Blessed Eid. Eid Mubarik ! </center></b>";s:7:"notices";s:7:"Notices";s:12:"notification";s:12:"Notification";s:17:"notification_type";s:17:"Notification Type";s:8:"november";s:8:"November";s:3:"now";s:3:"now";s:17:"number_of_replies";s:17:"Number of Replies";s:15:"number_of_views";s:15:"Number of Views";s:13:"numeric_value";s:4:"%1$s";s:24:"numeric_value_emphasized";s:21:"<strong>%1$s</strong>";s:7:"october";s:7:"October";s:3:"off";s:3:"Off";s:7:"offline";s:7:"Offline";s:4:"okay";s:4:"Okay";s:3:"old";s:3:"Old";s:5:"older";s:5:"Older";s:2:"on";s:2:"On";s:6:"online";s:6:"Online";s:19:"only_used_to_report";s:139:"<strong>Note</strong>: This is ONLY to be used to report spam, advertising messages, and problematic (harassment, figh