lect Content Type";s:12:"select_forum";s:12:"Select Forum";s:28:"separate_usernames_semicolon";s:38:"Separate multiple usernames with a '';''";s:11:"set_default";s:11:"Set Default";s:15:"set_tab_default";s:11:"Set Default";s:13:"setting_group";s:13:"Setting Group";s:16:"settings_to_edit";s:107:"Settings to Edit <dfn>Select the settings type you want to edit and click the "Edit Settings" button.</dfn>";s:8:"showperm";s:20:"Show Permission Name";s:26:"sitemap_blog_priority_desc";s:297:"This page allows you to control the priority setting in your XML sitemap based on blog popularity and age. The priority will be calculated for each blog post based on the values you put here. Note no matter what values you use the calculated priority will never be more than one or less than zero.";s:36:"sitemap_built_successfully_view_here";s:86:"Sitemap built successfully. You may view the XML <a href="../xmlsitemap.php">here</a>.";s:25:"sitemap_cms_priority_desc";s:347:"This page allows you to control the priority setting in your XML sitemap on a section-by-section basis. Setting a value for a section will change that section''s priority setting <i>as well as</i> the articles within that section. While you should set important sections to a higher priority, you should not set a high priority on too much content.";s:27:"sitemap_forum_priority_desc";s:334:"This page allows you to control the priority setting in your XML sitemap on a forum-by-forum basis. Setting a value for a forum will change that forum''s priority setting <i>as well as</i> the threads within that forum. While you should set important forums to a higher priority, you should not set a high priority on too much content.";s:24:"sitemap_priority_manager";s:24:"Sitemap Priority Manager";s:26:"skimlinks_advanced_options";s:26:"Skimlinks Advanced Options";s:28:"skimlinks_dissociate_account";s:18:"Dissociate account";s:24:"skimlinks_gloabal_is_off";s:348:"&nbsp;<br /><strong>Skimlinks is currently <span style="color: #ff0000;">disabled</span> for your forum.</strong><br /><br />To enable Skimlinks, please turn it <strong>On</strong> in the Global Options below.<br /><br /><strong>Note:</strong> The configuration settings that you have chosen will be respected when Skimlinks is enabled.<br />&nbsp;";s:28:"skimlinks_global_acc_details";s:15:"Account Details";s:25:"skimlinks_global_acc_info";s:19:"Account Information";s:27:"skimlinks_global_active_acc";s:16:"Activate account";s:28:"skimlinks_global_active_fail";s:48:"<strong>Account Activation Unsuccessful</strong>";s:31:"skimlinks_global_active_new_acc";s:20:"Activate new account";s:28:"skimlinks_global_active_succ";s:640:"<strong>Account Activation Successful</strong><br /><br />\r\n					Congratulations, we''ve activated your Skimlinks account and your Publisher ID has been associated with this plugin.<br /><br />\r\n					<strong>Please click Finish to complete the Activation process.</strong><br />&nbsp;<br />\r\n					You will shortly receive a welcome email to the address that you supplied containing your Skimlinks account and login details. If you don''t receive this email in the\r\n					next few minutes, please check your junk email folder. If it still isn''t there, please contact <a href="mailto:support@skimlinks.com">support@skimlinks.com</a>.<br /><br />";s:25:"skimlinks_global_alert_js";s:462:"To finalize your account dissociation, please press OK and then the Save button on the Global Options page of the Skimlinks plugin.\\n\\nOnce this is done, your Skimlinks account association will be removed from this plugin.\\n\\nSkimlinks products will no longer be active on your site.\\n\\nTo associate a different Skimlinks account, re-associate the same account, or activate a new account with this plugin, please use the appropriate buttons in the Setup section.";s:24:"skimlinks_global_all_req";s:23:"All fields are required";s:24:"skimlinks_global_ass_acc";s:17:"Associate account";s:28:"skimlinks_global_ass_ext_acc";s:26:"Associate existing account";s:25:"skimlinks_global_ass_note";s:202:"To associate your Skimlinks Account with this plugin, all you need to provide is the <strong>email address associated with your Skimlinks Account</strong> and your forum domain. We will do all the rest!";s:25:"skimlinks_global_ass_succ";s:304:"<strong>Account Association Successful</strong><br /><br />\r\n					Congratulations, we''ve successfully associated your Skimlinks account and your Publisher ID has been added to this plugin.<br />&nbsp;<br />\r\n					<strong>Please click Finish to complete the Association process.</strong><br />&nbsp;<br />";s:21:"skimlinks_global_back";s:4:"Back";s:23:"skimlinks_global_cancel";s:6:"Cancel";s:24:"skimlinks_global_confirm";s:7:"Confirm";s:28:"skimlinks_global_confirm_ass";s:130:"Please confirm that the details you have provided are correct to ensure that we can associate your Skimlinks account straightaway.";s:27:"skimlinks_global_confirm_js";s:338:"Please confirm you would like to remove the association between your Skimlinks account and this plugin. By doing so, all Skimlinks products will be immediately disabled on this forum.\\n\\nYou can always associate a different Skimlinks account, re-associate the same account, or activate a new account from the Setup section in this plugin.";s:29:"skimlinks_global_confirm_note";s:301:"Please confirm that the details you have provided are correct before we create your account. The email address that you provide\r\n						will become your Skimlinks account username and where we send all your account information, details and updates, so please especially make sure this field is correct.";s:27:"skimlinks_global_create_acc";s:14:"Create account";s:23:"skimlinks_global_domain";s:6:"Domain";s:26:"skimlinks_global_edit_info";s:16:"Edit information";s:22:"skimlinks_global_email";s:13:"Email address";s:23:"skimlinks_global_enable";s:60:"Globally enable the Skimlinks technology on your forum here:";s:22:"skimlinks_global_enter";s:5:"Enter";s:23:"skimlinks_global_finish";s:6:"Finish";s:24:"skimlinks_global_is_free";s:275:"Signing up to Skimlinks is free, takes hardly any time, and allows you to start earning through the Skimlinks technology straightaway. We only need the basics to get you started. Fill in the form below and your Skimlinks account will be immediately activated and ready to go.";s:21:"skimlinks_global_name";s:9:"Full Name";s:25:"skimlinks_global_ness_acc";s:48:"This field is necessary to activate your account";s:25:"skimlinks_global_ness_ass";s:49:"This field is necessary to associate your account";s:26:"skimlinks_global_new_setup";s:154:"If you are new to Skimlinks, simply Activate your new account. If you are already a Skimlinks publisher, Associate your existing account with this plugin.";s:26:"skimlinks_global_next_step";s:9:"Next step";s:26:"skimlinks_global_return_to";s:24:"Return to Global Options";s:22:"skimlinks_global_setup";s:5:"Setup";s:23:"skimlinks_global_status";s:14:"Setup - Status";s:25:"skimlinks_global_tos_note";s:840:"<small style="display: block; margin: 8px 0;"><strong>Note:</strong>\r\n						By activating your Skimlinks account, you are agreeing to abide by the Skimlinks <a href="http://skimlinks.com/terms/vbulletin" target="_blank">Terms of Service</a>. This contract will be between you and Skimlinks. You will be able to\r\n						track your site''s Skimlinks revenue by logging into your Skimlinks account, and revenues generated by the use of Skimlinks will be issued to the associated Skimlinks account.\r\n						The details you provide here will be sent to Skimlinks and your account immediately activated.\r\n						<br /><br />Please add <a href="mailto:support@skimlinks.com">support@skimlinks.com</a> to your email safe list as all email contact\r\n						from Skimlinks, including your account information and login, will come from this address.</small>";s:28:"skimlinks_global_valid_email";s:34:"Please enter a valid email address";s:29:"skimlinks_global_website_info";s:19: