r_images_from_filesystem_to_database";s:377:"<p>We are ready to attempt to move your images from the filesystem to the database.</p>\r\n\r\n<p>It is possible that you might not have enough space in the database, but we are unable to determine that ahead of time.</p>\r\n\r\n<p>We will not finalize the move until the end of the process. If the process aborts before the end, you will need to free up space before trying again.</p>";}', 'a:1492:{s:15:"0_matches_found";s:15:"0 Matches Found";s:15:"add_child_style";s:15:"Add Child Style";s:28:"add_new_replacement_variable";s:28:"Add New Replacement Variable";s:13:"add_new_style";s:13:"Add New Style";s:16:"add_new_template";s:16:"Add New Template";s:14:"additional_css";s:26:"Additional CSS Definitions";s:26:"additional_css_description";s:191:"Advanced Users: <dfn>&nbsp;<br />If you would like to add any additional CSS for use in your custom templates, any text entered here will be included at the end of the &lt;style&gt; tag</dfn>";s:20:"additional_functions";s:20:"Additional Functions";s:25:"adsense_advertising_intro";s:824:"This screen will allow you to quickly roll-out Google AdSense advertising units into your vBulletin forum advertising templates, based on your Google AdSense account settings defined in the members'' area at vBulletin.com.<br />\r\n<br />\r\nThere are two different advertising options available, Low and High, and an option to control the type of ad that is displayed.  Please choose the option that you would prefer for your community.<br />\r\n<br />\r\nPlease note that utilizing Google AdSense code within your site or community is subject to the <a href="https://www.google.com/adsense/localized-terms" target="_blank">Google AdSense terms and conditions</a>.<br />\r\n<br />\r\nTo further configure your Google AdSense account, please visit the <a href="https://www.google.com/adsense/" target="_blank">Google AdSense</a> website.";s:23:"adsense_deployment_high";s:71:"You are running the "High" package of G