itle";s:22:"Authorize.Net Login ID";s:45:"setting_authorizenet_authorize_md5secret_desc";s:177:"The MD5 Hash Security key as specified within the Security section of the Authorize.Net merchant account system. (This is not required by default so a blank setting is possible)";s:46:"setting_authorizenet_authorize_md5secret_title";s:21:"MD5 Hash Security Key";s:32:"setting_authorizenet_txnkey_desc";s:106:"The transaction key as specified within the Security section of the Authorize.Net merchant account system.";s:33:"setting_authorizenet_txnkey_title";s:29:"Authorize.Net Transaction Key";s:32:"setting_ccbill_clientAccnum_desc";s:56:"This is the main account number for your CCBill account.";s:33:"setting_ccbill_clientAccnum_title";s:33:"CCBill Client Main Account Number";s:32:"setting_ccbill_clientSubacc_desc";s:123:"This is the four digit code that corresponds to the sub account that you have created within CCBill for use with vBulletin.";s:33:"setting_ccbill_clientSubacc_title";s:32:"CCBill Client Sub Account Number";s:28:"setting_ccbill_formName_desc";s:118:"The Form Name Code corresponds to the 3 (or more) digit code that you have created within CCBill for this sub account.";s:29:"setting_ccbill_formName_title";s:26:"CCBill Form Character Code";s:28:"setting_ccbill_password_desc";s:233:"This is the password to access the CCBill Datalink server.  This is not required to utilize CCBill as a payment processor but it is required if you want subscriptions to be updated when a payment is refunded, voided, or charged back.";s:29:"setting_ccbill_password_title";s:17:"Datalink Password";s:30:"setting_ccbill_secretword_desc";s:106:"A secret word can be used to increase the security of accepting CCBill transactions. This is not required.";s:31:"setting_ccbill_secretword_title";s:18:"CCBill Secret Word";s:28:"setting_ccbill_username_desc";s:233:"This is the username to access the CCBill Datalink server.  This is not required to utilize CCBill as a payment processor but it is required if you want subscriptions to be updated when a payment is refunded, voided, or charged back.";s:29:"setting_ccbill_username_title";s:17:"Datalink Username";s:33:"setting_moneybookers_mbemail_desc";s:101:"Please enter your MoneyBookers email, all references to the subscription service will use this email.";s:34:"setting_moneybookers_mbemail_title";s:18:"MoneyBookers Email";s:34:"setting_moneybookers_mbsecret_desc";s:64:"Secret Word in lowercase as typed into your Moneybookers Profile";s:35:"setting_moneybookers_mbsecret_title";s:24:"Moneybookers Secret Word";s:28:"setting_nochex_ncxemail_desc";s:95:"Please enter your NoChex email, all references to the subscription service will use this email.";s:29:"setting_nochex_ncxemail_title";s:12:"NoChex Email";s:27:"setting_paypal_ppemail_desc";s:95:"Please enter your PayPal email, all references to the subscription service will use this email.";s:28:"setting_paypal_ppemail_title";s:12:"PayPal Email";s:32:"setting_paypal_primaryemail_desc";s:130:"Your PayPal primary account email that corresponds to the address above, this is required for recurring subscription verification.";s:33:"setting_paypal_primaryemail_title";s:28:"PayPal Primary Account Email";s:37:"setting_worldpay_worldpay_instid_desc";s:154:"The Install ID that is generated by the WorldPay CMS for the subscription callback. Please read the manual for instructions on how to change the password.";s:38:"setting_worldpay_worldpay_instid_title";s:24:"WorldPay Installation ID";s:39:"setting_worldpay_worldpay_password_desc";s:94:"The password entered during the creation of the subscription callback within the WorldPay CMS.";s:40:"setting_worldpay_worldpay_password_title";s:26:"WorldPay Callback Password";s:16:"shipping_address";s:16:"Shipping Address";s:33:"showing_subscriptions_x_to_y_of_z";s:42:"Showing Subscriptions %1$s to %2$s of %3$s";s:32:"showing_transactions_x_to_y_of_z";s:41:"Showing Transactions %1$s to %2$s of %3$s";s:24:"subscription_information";s:24:"Subscription Information";s:19:"subscription_length";s:19:"Subscription Length";s:20:"subscription_manager";s:20:"Subscription Manager";s:27:"subscription_payment_method";s:27:"Subscription Payment Method";s:24:"subscription_permissions";s:24:"Subscription Permissions";s:32:"subscription_permissions_manager";s:32:"Subscription Permissions Manager";s:18:"supported_currency";s:18:"Supported Currency";s:18:"supports_recurring";s:27:"Supports Recurring Payments";s:3:"tax";s:3:"Tax";s:28:"to_pay_for_your_subscription";s:148:"To pay for your subscription, please click the order button next to your preferred payment method and follow the instructions on the following page.";s:19:"transaction_details";s:19:"Transaction Details";s:15:"transaction_log";s:15:"Transaction Log";s:18:"transaction_lookup";s:18:"Transaction Lookup";s:17:"transaction_stats";s:17:"Transaction Stats";s:13:"transactionid";s:14:"Transaction ID";s:18:"twocheckout_prodid";s:10:"2CO ProdID";s:4:"type";s:4:"Type";s:10:"us_dollars";s:12:"U.S. Dollars";s:32:"validity_periods_marked_indicate";s:275:"				<p class="note">Validity periods marked with a <span class="highlight">*</span> indicate that this subscription is recurring.</p>\r\n				<p class="note">After the initial subscription period is complete, the subscription will automatically be renewed with a new charge.</p>";s:10:"view_users";s:10:"View Users";s:27:"worldpay_order_instructions";s:104:"To pay for your subscription using WorldPay click the button below and follow the onscreen instructions.";s:14:"x_subscription";s:17:"%1$s Subscription";}', 'a:88:{s:16:"add_new_language";s:16:"Add New Language";s:14:"add_new_phrase";s:14:"Add New Phrase";s:13:"all_languages";s:13:"All Languages";s:17:"all_phrase_groups";s:17:"ALL PHRASE GROUPS";s:12:"all_products";s:12:"All Products";s:38:"are_you_sure_want_to_delete_language_x";s:162:"Are you <b>sure</b> you want to delete the language called ''%1$s''?<br /><span class="smallfont">(%2$s: %3$s)</span><br /><br /> %