$s</i> by <b>%2$s</b><br />\r\nYour Custom Phrase Last Edited in <i>%3$s</i> by <b>%4$s</b>";s:12:"default_text";s:12:"Default Text";s:21:"default_text_is_empty";s:76:"Copying the default text would be tricky, as you haven''t typed anything yet!";s:24:"delete_all_orphans_notes";s:81:"You have chosen to delete all orphan phrases. Click the button below to continue.";s:49:"deleting_this_language_will_delete_custom_phrases";s:93:"Deleting this language will delete any customized phrases you have created for this language.";s:24:"download_upload_language";s:26:"Download / Upload Language";s:13:"edit_settings";s:13:"Edit Settings";s:26:"edit_translate_x_y_phrases";s:34:"Edit / Translate %1$s %2$s Phrases";s:29:"enable_directional_markup_fix";s:29:"Enable Directional Markup Fix";s:29:"find_and_replace_in_languages";s:29:"Find and Replace in Languages";s:19:"find_orphan_phrases";s:19:"Find Orphan Phrases";s:20:"find_updated_phrases";s:20:"Find Updated Phrases";s:16:"general_settings";s:16:"General Settings";s:12:"html_charset";s:140:"HTML Character Set\r\n<dfn>This is the value of the ''charset'' attribute for the HTML content type setting in the ''headinclude'' template.</dfn>";s:54:"if_you_delete_this_phrase_translations_will_be_deleted";s:117:"If you choose to delete this phrase, you will also lose any translated versions of the phrase in other language sets.";s:39:"if_you_would_like_to_remove_this_phrase";s:39:"If You Would Like to Remove this Phrase";s:23:"ignore_language_version";s:119:"Ignore Language Version <dfn>Use language file <b>even</b> if it was created by a different version of vBulletin?</dfn>";s:21:"image_folder_override";s:257:"Button Images Folder Override\r\n<dfn>Use this to override the button images folder associated with the style being used. By default, this folder is images/buttons.</dfn>\r\n<dfn>You may use &lt;#&gt; to represent the style ID the user is currently using.</dfn>";s:24:"import_language_xml_file";s:24:"Import Language XML File";s:18: