n>";s:15:"master_language";s:15:"MASTER LANGUAGE";s:20:"no_x_phrases_defined";s:33:"There are no %1$s phrases defined";s:17:"number_formatting";s:17:"Number Formatting";s:22:"overwrite_language_dfn";s:163:"Overwrite Language <dfn>(Selecting a language here will cause the imported language to overwrite an existing language. Leave blank to create a new language.)</dfn>";s:22:"overwriting_language_x";s:34:"Overwriting Language ''<i>%1$s</i>''";s:14:"phrase_manager";s:14:"Phrase Manager";s:16:"phrase_name_only";s:25:"Phrase Variable Name Only";s:27:"phrase_text_and_phrase_name";s:43:"Phrase Text <b>and</b> Phrase Variable Name";s:16:"phrase_text_only";s:16:"Phrase Text Only";s:25:"phrase_translation_desc_1";s:113:"When inserting a custom phrase, you may also specify the translations into whatever languages you have installed.";s:25:"phrase_translation_desc_2";s:95:"If you do leave a translation box blank, it will inherit the text from the ''Text to insert'' box";s:25:"phrase_translation_desc_3";s:55:"You may customize the translations further at any time.";s:24:"phrases_to_show_per_page";s:24:"Phrases to Show Per Page";s:8:"quickref";s:8:"QuickRef";s:22:"read_charset_from_file";s:26:"Read Charset from XML File";s:21:"rebuild_all_languages";s:21:"Rebuild All Languages";s:28:"rebuild_language_information";s:28:"Rebuild Language Information";s:21:"rebuilding_language_x";s:24:"Rebuilding Language %1$s";s:30:"registereddate_format_override";s:102:"Registration Date Format Override <dfn>Use this to override the default registration date format</dfn>";s:5:"right";s:5:"Right";s:13:"right_to_left";s:13:"Right to Left";s:18:"search_in_language";s:18:"Search in Language";s:17:"search_in_phrases";s:17:"Search in Phrases";s:14:"search_phrases";s:14:"Search Phrases";s:30:"search_translated_phrases_only";s:161:"Search Translated Phrases Only\r\n<dfn>When selecting a specific language, select ''Yes'' here to search translated phrases only, excluding untranslated items.</dfn>";s:15:"standard_phrase";s:15:"Standard Phrase";s:14:"text_direction";s:14:"Text Direction";s:19:"thousands_separator";s:179:"Thousands Separator <dfn>(The character used to separate thousands in formatted numbers, such as the , used in 1,024. To specify a space, please use the underscore <b>_</b>)</dfn>";s:20:"time_format_override";s:450:"Time Format Override\r\n<dfn>See: <a href="http://www.php.net/manual-lookup.php?function=strftime" target="_blank">http://www.php.net/manual-lookup.php?function=strftime</a><br /><br />\r\n<b>Examples:</b><br />\r\nAM/PM Time Format (eg, 11:15 PM): %I:%M %p (''h:i A'' if a locale is <b>not</b> specified)<br />\r\n<br />\r\n24-Hour Format Time (eg, 23:15): %H:%M (''H:i'' if a locale is <b>not</b> specified)<br />\r\nDefault Time Format for this Locale: %X\r\n</dfn>";s:27:"title_for_uploaded_language";s:109:"Title for Uploaded Language <dfn>(Leave blank to use the language title specified in the language file)</dfn>";s:28:"updated_default_phrases_desc";s:315:"The phrases shown on this page have been updated in the default language since you customized them.<br />\r\n<br />\r\nIt may be necessary for you to revert the custom phrases or otherwise check that they fully support vBulletin %1$s. <strong>If you do not do this, some sections of vBulletin may not function!</strong>";s:13:"view_language";s:13:"View Language";s:13:"view_quickref";s:13:"View QuickRef";s:12:"view_summary";s:12:"View Summary";s:9:"x_phrases";s:12:"%1$s Phrases";s:22:"x_phrases_containing_y";s:58:"%1$s Phrases Containing <span class="normal">''%2$s''</span>";}', 'a:29:{s:15:"add_new_bb_code";s:15:"Add New BB Code";s:37:"are_you_sure_want_to_delete_bb_code_x";s:161:"Are you <b>sure</b> you want to delete the BB code called ''%1$s''?<br /><span class="smallfont">(%2$s: %3$s)</span><br /><br /> %4$s This action cannot be undone.";s:7:"bb_code";s:7:"BB Code";s:20:"bb_code_explanations";s:1522:"<b>Explanations:</b><br /><br />\r\n<b>Title:</b> The title of your tag, which will be used to generate the <a href="../misc.php?do=bbcode">BB code list</a>.<br /><br />\r\n<b>Tag:</b> This is the text for the BB code, which goes inside the square brackets.<br />\r\ne.g. you would use ''b'' for [b] tags, ''url'' (without quotes) for [url] tags.<br /><br />\r\n<b>Replacement:</b> This is the HTML code for the BB code replacement. Make sure that you include ''{param}'' (without the quotes) to insert the text between the opening and closing BB code tags, and ''{option}'' for the parameter within the BB code tag. You can only use {option} if ''Use Option'' is set to yes.<br />\r\ne.g. you would use &lt;b>{param}&lt;/b> for tags, &lt;a href="{option}">{param}&lt;/a> for [url=xxx] . You will always use ''{param}'', but you will only use ''{option}'' when "Use Option?" is "yes". Note that ''{relpath}'' can be used in replacement code to signify the path of the current page. e.g. &lt;a href="{relpath}#{option}">{param}&lt;/a><br /><br />\r\n<b>Example:</b> This is a sample piece of BB code to use as an example for this particular BB code.<br />\r\ne.g. you would use [b]Bold[/b] for [b] tags, [url=http://www.example.com]Example Web Site[/url] for [url] tags<br /><br />\r\n<b>Description:</b> This is a piece of text to describe the BB code tag. This can include HTML tags if you wish.<br /><br />\r\n<b>Use Option:</b> Setting this option to yes will allow you to create a [tag=option][/tag] style tag, rather than just a [tag][/tag] style tag.";s:15:"bb_code_manager";s:15:"BB Code Manager";s:24:"bb_code_replacement_desc";s:579:"Replacement\r\n<dfn>Please be careful to use well formed HTML for your BB Code replacement. Failure to do so, can result in your bbcode being exploited by users. All HTML tag attributes should be enclosed in double quotes. Examples:</dfn>\r\n<ul>\r\n	<li>&lt;img <strong>src=&quot;{param}&quot;</strong> style=&quot;border:1px solid black&quot; /&gt;</li>\r\n	<li>&lt;a <strong>href=&quot;{option}&quot;</strong> style=&quot;border-color:red;border-style:outset;&quot; /&gt;{param}&lt;/a&gt;</li>\r\n</ul>\r\n\r\n<dfn>Note that the highlighted attributes are enclosed in double quotes.\r\n</dfn>";s:16:"bb_code_tag_name";s:16:"BB Code Tag Name";s:20:"bbcode_param_warning";s:130:"The following BB Code replacement may not be properly formed. All HTML attributes should be enclosed within double quotes.\r\n\r\n%1$s";s:29:"bbcode_plaintext_attachment_x";s:15:"Attachment %1$s";s:23:"bbcode_plaintext_code_x";s:33:"Code:\r\n---------\r\n%1$s\r\n---------";s:23:"bbcode_plaintext_html_x";s:33:"HTML:\r\n---------\r\n%1$s\r\n---------";s:24:"bbcode_plaintext_image_x";s:11:"Image: %1$s";s:22:"bbcode_plaintext_php_x";s:32:"PHP:\r\n---------\r\n%1$s\r\n---------";s:35:"bbcode_plaintext_quote_username_x_y";s:55:"---Quote (Originally by %1$s)---\r\n%2$s\r\n---End Quote---";s:24:"bbcode_plaintext_quote_x";s:34:"---Quote---\r\n%1$s\r\n---End Quote---";s:12:"button_image";s:12:"Button Image";s:17:"button_image_desc";s:236:"Button Image <i>(Optional)</i> <dfn>If you would like this BB code to appear as a clickable button on the message editor toolbar, enter the URL of an image 16 x 16 pixels in size that will act as the button to insert this BB code.</dfn>";s:24:"disable_bbcode_in_bbcode";s:35:"Disable BB Code Within This BB Code";s:25:"disable_smilies_in_bbcode";s:35:"Disable Smilies Within This BB Code";s:31:"disable_urlconversion_in_bbcode";s:50:"Disable Automatic Link Parsing Within This BB Code";s:26:"disable_wordwrap_in_bbcode";s:41:"Disable Word Wrapping Within This BB Code";s:23:"enter_text_with_bb_code";s:27:"Enter text with BB code(s):";s:7:"example";s:7:"Example";s:4:"html";s:4:"HTML";s:19:"remove_tag_if_empty";s:19:"Remove Tag If Empty";s:11:"replacement";s:11:"Replacement";s:17:"test_your_bb_code";s:17:"Test your BB Code";s:54:"this_is_how_your_test_appeard_after_bb_code_formatting";s:54:"This is how your text appears after BB code formatting";s:10:"use_option";s:12:"Use {option}";}', 'a:30:{s:11:"api_x_calls";s:10:"%1$s calls";s:8:"apicalls";s:5:"Calls";s:29:"apiclient_activity_statistics";s:26:"Client Activity Statistics";s:10:"blog_stats";s:15:"Blog Statistics";s:14:"date_ascending";s:14:"Date Ascending";s:15:"date_descending";s:15:"Date Descending";s:21:"include_empty_results";s:21:"Include empty results";s:18:"most_popular_forum";s:18:"Most popular forum";s:19:"most_replied_thread";s:22:"Most replied to thread";s:18:"most_viewed_thread";s:18:"Most viewed thread";s:19:"new_post_statistics";s:19:"New Post Statistics";s:21:"new_thread_statistics";s:21:"New Thread Statistics";s:13:"newest_member";s:27:"Newest member to the forums";s:19:"record_online_users";s:19:"Record online users";s:23:"registration_statistics";s:23:"Registration Statistics";s:5:"scope";s:5:"Scope";s:20:"start_date_after_end";s:32:"Start date is after the end date";s:57:"top_api_clients_viewer_page_x_y_there_are_z_total_clients";s:71:"Top API Clients Viewer (page %1$s/%2$s) | There are %3$s total clients.";s:57:"top_api_methods_viewer_page_x_y_there_are_z_total_methods";s:71:"Top API Methods Viewer (page %1$s/%2$s) | There are %3$s total methods.";s:13:"top_apiclient";s:10:"Top Client";s:14:"top_apiclients";s:15:"Top API Clients";s:13:"top_apimethod";s:14:"Top API Method";s:14:"top_apimethods";s:15:"Top API Methods";s:10:"top_poster";s:10:"Top poster";s:14:"top_statistics";s:14:"Top Statistics";s:15:"total_ascending";s:15:"Total Ascending";s:16:"total_descending";s:16:"Total Descending";s:4:"type";s:4:"Type";s:24:"user_activity_statistics";s:24:"User Activity Statistics";s:6:"weekly";s:6:"Weekly";}', 'a:54:{s:38:"check_mail_server_configured_correctly";s:178:"Check your mail server to ensure it is configured correctly to allow PHP to send mail from it. You should also check your mail server''s error log for more diagnostic information.";s:7:"details";s:7:"Details";s:24:"email_sent_check_shortly";s:248:"No errors were returned while attempting to send the email. Check %1$s shortly to confirm you''ve received the email. If you don''t receive the email, try sending the test to a different address. If that fails, check your mail server''s configuration.";s:20:"email_test_explained";s:238:"The goal of this test is to determine whether any vBulletin or PHP settings must be changed to allow the sending of email through vBulletin. To begin, simply enter an email address that you have the ability to access and click Send Email.";s:34:"facebook_connect_ssl_req_explained";s:193:"The Facebook OpenGraph API requires all communication to use Transport Layer Security or Secure Socket layer (TLS/SSL) for security. This test will check if TLS/SSL is available on your server.";s:22:"file_contents_mismatch";s:39:"File does not contain expected contents";s:35:"file_copied_to_tmp_dir_now_readable";s:160:"After copying the file into the specified "Safe Mode Temp Directory", it became readable. Uploads will function, but only when uploading in safe mode is enable.";s:37:"file_copied_to_tmp_dir_now_unreadable";s:218:"After copying the file into the specified "Safe Mode Temp Directory," it remained unreadable. PHP''s safe_mode setting must be disabled for uploads to function. You will need to contact your host for this to be changed.";s:14:"file_not_found";s:14:"File not found";s:17:"file_not_readable";s:17:"File not readable";s:19:"file_not_recognized";s:40:"File not recognized as part of vBulletin";s:23:"file_upload_setting_off";s:165:"File uploads have been turned off via PHP''s file_uploads setting. This can only be handled by contacting your host and asking them to enable the file_upload setting.";s:34:"file_version_mismatch_x_expected_y";s:48:"File version mismatch: found %1$s, expected %2$s";s:23:"file_versions_explained";s:290:"This function will list each of your vBulletin files that is tagged with a different version than your forum is currently at, which is <b>%1$s</b>.<br />\r\n<br />\r\nThis tool is intended to verify the integrity of your vBulletin files and only scans files with a limited number of extensions.";s:34:"mail_function_errors_returned_were";s:72:"The following errors were outputted by PHP when attempting to send mail:";s:28:"mail_function_returned_error";s:69:"The mailing function returned an error while trying to send the mail.";s:23:"mod_security_ajax_issue";s:18:"AJAX Unicode Issue";s:25:"mod_security_problem_desc";s:267:"The above setting will indicate if mod_security is preventing some AJAX requests from being submitted to vBulletin. If this shows Yes then you either need to disable mod_security or change the AJAX settings with the vBulletin Options and disable Problematic features.";s:13:"module_loaded";s:13:"Module Loaded";s:12:"mysql_status";s:12:"MySQL Status";s:15:"mysql_variables";s:15:"MySQL Variables";s:32:"no_errors_occured_opening_upload";s:63:"No errors occurred while opening the uploaded file for reading.";s:22:"open_basedir_in_effect";s:306:"PHP''s <b>open_basedir</b> setting has been set to %1$s. The uploaded file was stored outside of this directory and is not readable. You will need to contact your host and ask them to specify <b>upload_tmp_dir</b> with a directory inside %1$s. Note that PHP must be able to read and write to this directory.";s:4:"pass";s:4:"Pass";s:17:"payment_api_tests";s:17:"Payment API Tests";s:22:"pertinent_php_settings";s:22:"Pertinent PHP Settings";s:23:"pertinent_smtp_settings";s:23:"Pertinent SMTP Settings";s:26:"problematic_server_modules";s:29:"Problematic Webserver Modules";s:36:"problematic_server_modules_explained";s:134:"Some server modules can cause asymptomatic problems with vBulletin, these diagnostics will help identify if the modules are installed.";s:21:"safe_mode_dir_not_dir";s:157:"The "Safe Mode Temp Directory" you have specified (%1$s) does not appear to be a directory. Please specify the correct directory and attempt this test again.";s:28:"safe_mode_enabled_no_tmp_dir";s:155:"You have safe mode uploading enabled but have not specified "Safe Mode Temp Directory". Please specify one on the options page and attempt this test again.";s:23:"safe_mode_not_writeable";s:189:"The "Safe Mode Temp Directory" you have specified (%1$s) is not writeable by PHP. You will most likely need to make this directory world writeable. Correct this and attempt this test again.";s:15:"scanned_x_files";s:18:"Scanned %1$s files";s:23:"server_information_desc";s:154:"While not exactly a test, this function is helpful for tracking down server issues. Simply select the appropriate type of information and submit the form.";s:13:"smtp_username";s:14:"SMTP Username:";s:13:"ssl_available";s:31:"TLS/SSL Communication Available";s:20:"ssl_unavailable_desc";s:216:"If the above test shows "No", then you will need to contact your hosting provider and ask for cURL to be installed with TLS/SSL support or for OpenSSL to be enabled in PHP to be able to use Facebook Connect features.";s:20:"suhosin_problem_desc";s:118:"Suhosin can limit the amount of data submitted and encrypt cookies causing problems with several aspects of vBulletin.";s:21:"suspect_file_versions";s:21:"Suspect File Versions";s:18:"system_information";s:18:"System Information";s:12:"table_status";s:12:"Table Status";s:20:"test_cannot_continue";s:25:"The test cannot continue.";s:31:"test_indeterminate_contact_host";s:295:"The test was indeterminate. There were problems reading the uploaded file, but none of PHP''s settings were identified as causing a problem. At this point, you should attempt to attach a file to a post. If that fails, contact your host as no one will know their own server setup better than them.";s:7:"tls_ssl";s:7:"TLS/SSL";s:25:"turn_safe_mode_option_off";s:93:"You should be able to turn off the "Upload In Safe Mode?" option without any adverse effects.";s:28:"unable_to_copy_attached_file";s:171:"The attached file could not be copied to %1$s. PHP''s safe_mode setting must be disabled for uploads to function. You will need to contact your host for this to be changed.";s:28:"unable_to_find_attached_file";s:70:"The attached file''s temporary location (%1$s) could not be found. %2$s";s:24:"unable_to_open_directory";s:24:"Unable to open directory";s:16:"unable_to_open_x";s:32:"Unable to open file: <b>%1$s</b>";s:16:"upload_test_desc";s:260:"This test''s purpose is to determine if there are any vBulletin/PHP options you need to change for uploads to function correctly. To begin, simply attach a small file using the box below and submit the form. vBulletin will not save the attached file in any way.";s:20:"vbulletin_email_test";s:20:"vBulletin Email Test";s:24:"vbulletin_email_test_msg";s:590:"You are receiving this email because your email address was entered as an email test at %1$s.\r\n\r\nThe first step of this email test script has been completed. However, a formatting test is still necessary:\r\n\r\nA paragraph break.\r\nA single line break.\r\n\r\nAnother paragraph break.\r\nAnother single line break.\r\nAnother single line break.\r\n\r\nIf the above lines look correct, you are finished. The email features on your server are setup correctly.\r\nIf this email is run together on one line, there is possibly a configuration error with your mail server. Please ensure it is configured correctly.";s:26:"vbulletin_email_test_withf";s:40:"vBulletin Email Test (With -f Parameter)";s:7:"version";s:7:"Version";}', 'a:180:{s:12:"add_keywords";s:12:"Add Keywords";s:27:"add_missing_thread_keywords";s:27:"Add Missing Thread Keywords";s:43:"affected_accounts_that_were_last_active_x_y";s:67:"<strong>Affected accounts that were last active %1$s: %2$s</strong>";s:19:"affected_accounts_x";s:23:"Affected Accounts: %1$s";s:18:"anon_server_survey";s:23:"Anonymous Server Survey";s:23:"anon_server_survey_desc";s:891:"<p class="smallfont">In order to provide products that are well-suited to the servers and sites that currently run vBulletin,\r\n		we are running a survey to find out what kind of capabilities our customers'' servers have, and what scale\r\n		of bulletin boards they run.</p>\r\n		<p class="smallfont">By submitting this survey to vBulletin.com you will help us to ensure that our forthcoming releases\r\n		are both compatible with and make full use of the services available on your servers.</p>\r\n		<p class="smallfont">There is some data at the bottom of the form that is optional for you to submit. This information\r\n		describes your own board, and lets us know how busy etc. your site is.</p>\r\n		<p class="smallfont">The information submitted in this survey is <strong>entirely anonymous</strong> and no information that can identify\r\n		the site that posted the survey data will be collected.</p>";s:14:"apache_modules";s:14:"Apache Modules";s:24:"are_you_sure_empty_index";s:48:"Are you sure you wish to empty the search index?";s:30:"building_attachment_thumbnails";s:212:"Building Attachment Thumbnails<dfn>If you receive a fatal error or if the process seems to hang, you will need to delete the last attachment listed on the screen then <a href="%1$s">refresh</a> this window.</dfn>";s:26:"building_avatar_thumbnails";s:214:"Building Avatar Thumbnails<dfn>If you receive a fatal error or if the process seems to hang, you will need to delete the last avatar thumbnail listed on the screen then <a href="%1$s">refresh</a> this window.</dfn>";s:19:"building_post_cache";s:19:"Building Post Cache";s:21:"building_search_index";s:21:"Building Search Index";s:26:"building_sgicon_thumbnails";s:212:"Building Group Icon Thumbnails<dfn>If you receive a fatal error or if the process seems to hang, you will need to delete the last  thumbnail listed on the screen then <a href="%1$s">refresh</a> this window.</dfn>";s:34:"calculating_profile_pic_dimensions";s:38:"Calculating Profile Picture Dimensions";s:36:"change_output_signatures_empty_cache";s:156:"If you have made changes that affect the output of signatures, you may use this to empty the cache and force signatures to be rebuilt with the new settings.";s:20:"character_sets_usage";s:21:"Character Sets in Use";s:33:"check_accounts_with_last_activity";s:33:"Check Accounts with Last Activity";s:23:"check_affected_accounts";s:23:"Check Affected Accounts";s:22:"check_styles_no_parent";s:31:"Check For Styles With No Parent";s:25:"clear_cached_text_entries";s:100:"This function will clear any cached text entries, these will be rebuilt next time they are accessed.";s:23:"clear_parsed_text_cache";s:23:"Clear Parsed Text Cache";s:28:"confirm_prefix_change_x_to_y";s:53:"Confirm Table Prefix Change (From ''%1$s'' to ''%2$s'')\r\n";s:24:"delete_duplicate_threads";s:24:"Delete Duplicate Threads";s:8:"delete_x";s:11:"Delete %1$s";s:35:"deleted_orphan_threads_successfully";s:35:"Deleted Orphan Threads Successfully";s:10:"email_from";s:10:"Email From";s:30:"email_permanently_banned_users";s:196:"Email Permanently Banned Users\r\n<dfn>If you select no, permanently banned users'' passwords will be reset, but they will not receive an email. Temporarily banned users will always be emailed.</dfn>";s:13:"email_subject";s:13:"Email Subject";s:21:"email_to_send_at_once";s:21:"Email to Send At Once";s:21:"empty_signature_cache";s:21:"Empty Signature Cache";s:24:"error_attachment_missing";s:25:"Error: Attachment Missing";s:24:"error_thumbnail_failed_x";s:27:"Error:  Library Error: %1$s";s:29:"error_thumbnail_nocreateimage";s:52:"Error: Invalid image file or GD version is set wrong";s:30:"error_thumbnail_nogetimagesize";s:37:"Error: Could not determine image size";s:21:"error_thumbnail_nogif";s:28:"Error: PHP lacks GIF support";s:21:"error_thumbnail_nojpg";s:28:"Error: PHP lacks JPG support";s:21:"error_thumbnail_nopng";s:28:"Error: PHP lacks PNG support";s:25:"error_thumbnail_nosupport";s:52:"No support for this type in the chosen image library";s:31:"error_thumbnail_notcorrectimage";s:33:"Incorrect extension for this file";s:31:"error_thumbnail_notenoughmemory";s:24:"Error: Not Enough Memory";s:22:"error_thumbnailalready";s:34:"Image is already <= thumbnail size";s:36:"finds_users_without_complete_entries";s:204:"Finds any users who do not have complete entries in the database. Sometimes the data is not inserted correctly and the user''s profile becomes unusable. Running this should correct any incomplete profiles.";s:15:"first_post_date";s:15:"First Post Date";s:24:"fix_broken_user_profiles";s:24:"Fix broken user profiles";s:38:"function_allows_rebuild_all_style_info";s:173:"This function allows you to completely rebuild all style information. This is necessary after a major upgrade, or if you have manually edited any of the ''special'' templates.";s:28:"function_rebuilds_reputation";s:239:"This function recalculates user reputation using the value that you specify below then adds the total reputation the user has received so far.  This will remove any custom reputation that has been given to the user through the user editor.";s:28:"function_rebuilds_thumbnails";s:161:"This function rebuilds the attachment thumbnails. It is needed when you enable thumbnails,  change the thumbnail dimensions, or change the thumbnail JPG quality.";s:29:"function_removes_orphan_posts";s:76:"This function removes all posts that belong to threads that no longer exist.";s:33:"function_removes_orphan_stylevars";s:229:"This function removes all custom stylevar entries from the database where the stylevar no longer exists in the current master list. This removal is permanent so please make sure your custom styles are not using any old stylevars.";s:31:"function_removes_orphan_threads";s:77:"This function removes all threads that belong to forums that no longer exist.";s:37:"include_automatic_javascript_redirect";s:51:"Include automatic JavaScript redirect to next page?";s:17:"last_upgrade_date";s:17:"Last Upgrade Date";s:26:"list_of_tables_in_db_below";s:218:"<p>Below is a list of all the tables in your database.\r\nYou should make sure that you select <b>only</b> tables that are part of vBulletin.</p>\r\n<p><b>If you are not sure, do not continue with this operation.</b></p>\r\n";s:10:"max_height";s:14:"Maximum Height";s:9:"max_width";s:13:"Maximum Width";s:22:"new_prefix_same_as_old";s:148:"You have not chosen a new table prefix, this script cannot continue.<br /><br />\r\n(Old table prefix: ''<b>%1$s</b>'', new table prefix: ''<b>%2$s</b>'')";s:14:"new_table_name";s:16:"New Table Name\r\n";s:16:"new_table_prefix";s:18:"New Table Prefix\r\n";s:32:"note_duplicate_threads_have_same";s:146:"<b>Note:</b> Duplicate threads are threads that have the same title, post name, and post time and are posting in the same forum as another thread.";s:32:"note_rebuild_similar_thread_list";s:166:"<b>Note:</b> This will rebuild the similar thread list regardless of whether they are enabled or not. However, they will not be displayed until the option is enabled.";s:31:"note_reindexing_empty_indexes_x";s:399:"<b>Note:</b>\r\nYou should not normally need to empty the search index, however if items are showing in search results after they have been permanently deleted then emptying the index and rebuilding the search index will fix this.  Search will not work correctly after emptying the index until the index is fully rebuilt.\r\n<a href="misc.php?%1$sdo=emptyindex">Click Here to empty the search index.</a>";s:21:"note_server_intensive";s:48:"<b>Note:</b> This is a server intensive process.";s:42:"number_of_attachments_to_process_per_cycle";s:42:"Number of attachments to process per cycle";s:38:"number_of_avatars_to_process_per_cycle";s:38:"Number of avatars to process per cycle";s:37:"number_of_forums_to_process_per_cycle";s:37:"Number of forums to process per cycle";s:36:"number_of_icons_to_process_per_cycle";s:36:"Number of icons to process per cycle";s:39:"number_of_pictures_to_process_per_cycle";s:39:"Number of pictures to process per cycle";s:36:"number_of_posts_to_process_per_cycle";s:36:"Number of posts to process per cycle";s:38:"number_of_threads_to_process_per_cycle";s:38:"Number of threads to process per cycle";s:36:"number_of_users_to_process_per_cycle";s:36:"Number of users to process per cycle";s:16:"old_table_prefix";s:18:"Old Table Prefix\r\n";s:45:"only_accounts_using_language_x_were_processed";s:80:"Only accounts configured to use the language ''%1$s'' were processed and notified.";s:13:"optional_info";s:20:"Optional Information";s:19:"original_table_name";s:21:"Original Table Name\r\n";s:23:"orphan_stylevar_deleted";s:43:"<br />Deleted %1$s from Style <em>%2$s</em>";s:30:"orphan_stylevar_deleted_master";s:49:"<br />Deleted %1$s from the <em>Master Style</em>";s:37:"orphan_stylevar_deleted_mobile_master";s:56:"<br />Deleted %1$s from the <em>Mobile Master Style</em>";s:20:"other_prefix_warning";s:202:"<b>WARNING!</b><br />The following tables do <b>not</b> have the\r\noriginal table prefix! These tables may not be part of vBulletin.\r\n<ul>%1$s</ul>\r\nAre you <b>absolutely sure</b> you want to continue?\r\n";s:16:"over_1_month_ago";s:16:"Over 1 month ago";s:15:"over_1_week_ago";s:15:"Over 1 week ago";s:15:"over_any_period";s:15:"Over any period";s:15:"over_x_days_ago";s:18:"Over %1$s days ago";s:17:"over_x_months_ago";s:20:"Over %1$s months ago";s:16:"over_x_weeks_ago";s:19:"Over %1$s weeks ago";s:21:"password_check_notice";s:1479:"Some users may have created accounts with vulnerable passwords.  Vulnerable passwords can be passwords that are:<br />\r\n<ul><li>The same as the account username</li></ul>\r\nSuch passwords make accounts vulnerable to exploitation from automated scripts and programs that can guess the password to access your board under the guise of the\r\naffected users.  This may be done for the purposes of spam or online identity theft.<br /><br />\r\nUsers can no longer create accounts with the above vulnerabilities, but older accounts may still be affected.  Affected users will be prompted to change their current password the next time they login.  However, older accounts may still be vulnerable where the user no longer uses the account to access your board. Note that if you force a reset of an account and the email address associated with the account is no longer valid, the user may effectively be locked out of that account.<br /><br />\r\nFor this reason you may choose which accounts to reset based on the users'' last activity.  Users who have recently logged in are more likely to change their password and email settings themselves.\r\nIt is advised that accounts that have not been accessed recently are reset first.  You can check at a later time or date how many affected accounts remain before deciding to force a password reset.<br /><br />\r\nWhen you perform a reset, an email will be sent to the affected users.  You will have an option to change the email message.<br /><br />";s:42:"password_vulnerability_email_message_label";s:324:"Email Message<dfn>You can change the default message that is sent to users when their password is reset.<br /><br />The  tokens {username} and {password} can be placed in the message and will be replaced by their values for each individual user.<br /><br /><strong>You must insert the token {password} in the email.</strong>";s:15:"passwords_reset";s:15:"Passwords Reset";s:14:"php_extensions";s:14:"PHP Extensions";s:16:"php_openbase_dir";s:16:"PHP Open Basedir";s:13:"php_safe_mode";s:13:"PHP Safe Mode";s:34:"please_read_notes_after_completion";s:77:"Please read the notes at the bottom of this page when processing is complete.";s:19:"post_id_to_start_at";s:19:"Post ID to start at";s:13:"posts_queried";s:13:"Posts Queried";s:21:"prefix_change_confirm";s:326:"<p>If you are <b>sure</b> you want to continue and rename the tables listed\r\nabove, click the rename button below.</p>\r\n<p><b>Note:</b> This is your final chance to stop. Clicking the button below will alter\r\nall the tables listed above, requiring you to edit your config.php file\r\nbefore your vBulletin will work again.</p>\r\n";s:17:"processing_time_x";s:21:"Processing Time: %1$s";s:29:"querying_first_post_of_thread";s:32:"Querying f