uild Styles";s:26:"rebuild_thread_information";s:26:"Rebuild Thread Information";s:23:"rebuild_user_reputation";s:23:"Rebuild User Reputation";s:37:"recalculate_users_post_counts_warning";s:497:"This will recalculate all of your user''s post counts based on their CURRENT posts in the database. Do not run this if you have pruned posts, manually changed post counts, or imported from another forum package and you wish to maintain your users'' current counts. Your members'' post counts will PROBABLY decrease so only run this if you believe you really need to! Once they decrease you cannot bring them back up without restoring your database or manually editing each user. You have been warned!";s:19:"remove_orphan_posts";s:19:"Remove Orphan Posts";s:23:"remove_orphan_stylevars";s:23:"Remove Orphan Stylevars";s:21:"remove_orphan_threads";s:21:"Remove Orphan Threads";s:26:"removing_duplicate_threads";s:29:"Removing duplicate threads...";s:23:"removing_orphan_threads";s:23:"Removing Orphan Threads";s:17:"rename_sql_tables";s:17:"Rename SQL Tables";s:14:"rename_table_x";s:27:"Rename Table <b>%1$s</b>?\r\n";s:13:"rename_tables";s:15:"Rename Tables\r\n";s:25:"renaming_process_complete";s:27:"Renaming Process Complete\r\n";s:30:"renaming_table_with_new_prefix";s:37:"Renaming Tables With New Table Prefix";s:15:"renaming_x_to_y";s:40:"Renaming <b>%1$s</b> to <b>%2$s</b> ... ";s:31:"renumber_all_templates_from_one";s:187:"Renumber all templates from 1 <dfn><b>Note:</b> this option requires that your MySQL account has ALTER, CREATE and DROP privileges.<br />If you are not sure, do not use this option!</dfn>";s:15:"reputation_base";s:21:"Base Reputation Value";s:33:"reset_accounts_with_last_activity";s:33:"Reset Accounts with Last Activity";s:30:"reset_password_if_email_failed";s:193:"Reset Password if Email Failed\r\n<dfn>This option allows you to reset the password even if the email attempt failed. Only choose this option if the email attempts are failing consistently.</dfn>";s:15:"