_activate_products_within_these_forums";s:48:"Activate Skimlinks products within these forums:";s:31:"skimlinks_activate_skimlinks_in";s:24:"Activate SkimLinks in...";s:31:"skimlinks_activate_skimwords_in";s:24:"Activate SkimWords in...";s:26:"skimlinks_active_in_forums";s:53:"SkimLinks will be active within the following forums:";s:27:"skimlinks_active_usergroups";s:71:"SkimLinks will be active for viewing users in the following usergroups:";s:31:"skimlinks_advanced_options_help";s:1393:"<b>SkimLinks</b> will automatically convert links to merchants (eBay, Amazon, Bestbuy etc.)\r\nthat forum users have added to affiliate links when clicked.\r\nIf a sale is made, you earn a commission.\r\nThis is virtually invisible to your forum users (a small redirect when tracking is added),\r\nso it is recommended to be enabled for <b>all</b> usergroups and forums.<br />\r\n<br />\r\n<b>SkimWords</b> will automatically convert product references in posts into shopping links.\r\nSince SkimWords adds links where there weren''t any before, it is visible to your end users.\r\nHowever, it is well-targeted and never adds too many links to the page.\r\nFor the best revenue opportunity it is recommended to be enabled for <b>all</b> usergroups and forums.<br />\r\n<br />\r\nYou may hide SkimLinks and SkimWords features from visitors belonging to specific usergroups, disable it for entire forums, by the age of threads, and allow your users to control the activation of products.<br />\r\nNote that if a user belongs to <em>any</em> usergroup that has SkimLinks or SkimWords disabled, this will disable SkimLinks or SkimWords for them regardless of their membership of any groups that may have SkimLinks or SkimWords enabled.<br />\r\n<br />\r\n<b>Note</b>: Please ensure SkimLinks and SkimWords are enabled in your <a href="https://accounts.skimlinks.com/settings" target="_blank">Skimlinks Publisher Interface</a>.";s:14:"skimlinks_days";s:4:"days";s:17:"skimlinks_enabled";s:16:"Enable Skimlinks";s:42:"skimlinks_for_visitors_in_these_usergroups";s:33:"For visitors in these usergroups:";s:37:"skimlinks_global_settings_description";s:100:"If you have selected ''On'' and your publisher ID is present, Skimlinks will be enabled on your forum!";s:38:"skimlinks_in_posts_by_these_usergroups";s:34:"In posts made by these usergroups:";s:29:"skimlinks_options_description";s:856:"SkimLinks will automatically convert links to merchants (eBay, Amazon, Bestbuy etc.)\r\nthat forum users have added to affiliate links when clicked.\r\nIf a sale is made, you earn a commission.\r\nThis is virtually invisible to your forum users (a small redirect when tracking is added),\r\nso it is recommended to be enabled for <b>all</b> usergroups and forums.<br />\r\n<br />\r\nYou may hide SkimLinks features from visitors belonging to specific usergroups, or disable it for entire forums.\r\nNote that if a user belongs to <i>any</i> usergroup that has SkimLinks disabled, this will disable SkimLinks for them regardless of\r\ntheir membership of any groups that may have SkimLinks enabled.<br />\r\n<br />\r\n<b>Note</b>: You must ensure SkimLinks is enabled in your <a href="https://accounts.skimlinks.com/settings" target="_blanks">publisher admin settings page</a>.";s:22:"skimlinks_options_hint";s:325:"You can control the activation of SkimLinks and SkimWords products in various ways including by Usergroups,  sections of your Forum, age of Threads, and allowing Users to control the activation of products themselves.<br />Please visit the Advanced Settings page from the menu on the left to view and configure these options.";s:28:"skimlinks_plugin_description";s:924:"<a href="http://skimlinks.me/vbhome" target="_blank">Skimlinks</a> is a simple and easy monetization technology for your forum, available in two products:<br /><br /><strong>&#8226; SkimLinks</strong> automatically converts existing retailer URLs in your posts into affiliate links on-the-fly.<br /><br /><strong>&#8226; SkimWords</strong> turns product references in your content into links to the best performing retailer for that product.<br /><br />We work with over 12,000 retailers from around the world, rewarding you for the role your forum plays in creating and informing purchase intent.<br />Find out more about <a href="http://skimlinks.com/video" target="_blank">how Skimlinks works</a>, or <a href="http://skimlinks.me/vbcontact" target="_blank">Contact us</a> if you have any questions.<br /><br />Use this panel to enable Skimlinks quickly on your vBulletin forum and configure when it appears to your users.";s:51:"skimlinks_product_activation_based_on_age_of_thread";s:57:"Limit Skimlinks product activation based on age of thread";s:53:"skimlinks_products_will_be_active_in_these_usergroups";s:51:"Activate products for visitors in these usergroups:";s:59:"skimlinks_products_will_be_active_posts_by_these_usergroups";s:53:"Activate products for posts made by these usergroups:";s:16:"skimlinks_pub_id";s:22:"Skimlinks publisher ID";s:25:"skimlinks_time_limit_note";s:370:"<strong>Note:</strong> These settings are executed after, but fully respect and are in addition to,\r\nany settings in the <em>Usergroups</em> and <em>Forums</em> sections above.\r\nFor example, if you have chosen to deactivate SkimWords for Moderators and only have SkimWords active on\r\nposts older than one day, any posts by Moderators over one day old are still excluded.";s:39:"skimlinks_user_disable_explain_text_dfn";s:284:"This is the text that will be displayed to your users when this option is fully enabled, explaining what Skimlinks is and that they can choose to disable it if they so wish.<br />\r\n<br />\r\n<strong>Note</strong>: the text included is suggested, but is fully editable to fit your needs.";s:41:"skimlinks_user_disable_explain_text_label";s:41:"Explanatory text to use for this option: ";s:26:"skimwords_active_in_forums";s:53:"SkimWords will be active within the following forums:";s:27:"skimwords_active_usergr