;s:35:"To close this poll, check this box.";s:14:"update_options";s:14:"Update options";}', 'a:100:{s:14:"advanced_lists";s:14:"Advanced Lists";s:17:"attach_tag_allows";s:174:"The [attach] tag allows you to display an attachment in your post rather than at the bottom. It will only display attachments that belong to the post in which it is utilized.";s:12:"attachmentid";s:12:"attachmentid";s:17:"available_for_use";s:22:"Available for Your Use";s:11:"avatar_list";s:11:"Avatar List";s:7:"avatars";s:7:"Avatars";s:20:"avatars_small_images";s:222:"Avatars are small graphical images that you may choose in your profile.\r\n		They are displayed by your username on all posts that you make.\r\n		You can select the image that best describes yourself from your profile options.";s:20:"b_i_and_u_tags_allow";s:87:"The [b], [i] and [u] tags allow you to create text that is bold, italic and underlined.";s:7:"bb_code";s:7:"BB Code";s:21:"bb_code_based_on_html";s:509:"BB code is a set of tags based on the HTML language that you may already be familiar with.\r\n		They allow you to add formatting to your messages in the same way as HTML does,\r\n		but have a simpler syntax and will never break the layout of the pages you are viewing.\r\n		The ability to use BB code is set on a forum-by-forum basis by the administrator,\r\n		so you should check the forum rules when you post a new message.<br />\r\n		<br />\r\n		Below is a list of the BB code tags you can use to format your messages.";s:11:"bbcode_list";s:12:"BB Code List";s:4:"bold";s:4:"Bold";s:14:"bulleted_lists";s:14:"Bulleted Lists";s:6:"center";s:6:"Center";s:22:"click_here_to_email_me";s:22:"Click Here to Email Me";s:8:"click_me";s:9:"Click Me!";s:17:"code_tag_switches";s:84:"The [code] tag switches to a fixed-width (monospace) font and preserves all spacing.";s:5:"color";s:5:"Color";s:16:"color_tag_allows";s:60:"The [color] tag allows you to change the color of your text.";s:13:"email_linking";s:13:"Email Linking";s:16:"email_tag_allows";s:114:"The [email] tag allows you to link to an email address. You can include an optional parameter to ''name'' your link.";s:14:"example_output";s:14:"Example Output";s:13:"example_usage";s:13:"Example Usage";s:11:"explanation";s:11:"Explanation";s:8:"faq_item";s:8:"FAQ Item";s:4:"font";s:4:"Font";s:15:"font_tag_allows";s:58:"The [font] tag allows you to change the font of your text.";s:9:"highlight";s:9:"Highlight";s:20:"highlight_tag_allows";s:54:"The [highlight] tag allows you to emphasize your text.";s:15:"html_tag_allows";s:71:"The [html] tag allows you to perform syntax highlighting for HTML code.";s:6:"images";s:6:"Images";s:14:"img_tag_allows";s:137:"The [img] tag allows you to embed images within your posts. You can also combine this tag with the [url] tag to make images become links.";s:23:"incorrect_bb_code_usage";s:440:"<b>Incorrect BB Code Usage:</b>\r\n		<ul>\r\n		  <li><span class="highlight">[url]</span> www.example.com <span class="highlight">[/url]</span> - don''t put spaces between the bracketed code and the text you are applying the code to.</li>\r\n		  <li><span class="highlight">[email]</span>myname@domain.com<span class="highlight">[email]</span> - the end brackets must include a forward slash (<span class="highlight">[/email]</span>)</li>\r\n		</ul>";s:6:"indent";s:6:"Indent";s:17:"indent_tag_allows";s:48:"The [indent] tag allows you to indent your text.";s:6:"italic";s:6:"Italic";s:4:"left";s:4:"Left";s:32:"left_right_and_center_tags_allow";s:85:"The [left], [right] and [center] tags allow you to change the alignment of your text.";s:6:"linked";s:6:"Linked";s:11:"list_item_1";s:11:"list item 1";s:11:"list_item_2";s:11:"list item 2";s:15:"list_tag_allows";s:153:"The [list] tag allows you to create simple, bulleted lists without specifying an option. Within the value portion, each bullet is denoted by the [*] tag.";s:24:"list_tag_allows_advanced";s:344:"The [list] tag allows you to create advanced lists by specifying an option. The option should have a value of 1 (for a numbered list) or A (for an alphabetic with capital letters list) or a (for an alphabetic with lowercase letters list) or I (for a numbered with capital Roman numeral list) or i (for a numbered with small Roman numeral list).";s:15:"match_all_words";s:9:"All words";s:15:"match_any_words";s:9:"Any words";s:21:"match_complete_phrase";s:15:"Complete phrase";s:20:"matching_description";s:261:"Select an option here to specify how you would like your search query to be treated. ''Any words'' will return the most numerous but possibly least relevant results, while ''Complete phrase'' will return only results that contain exactly what you are searching for.";s:7:"meaning";s:7:"Meaning";s:31:"no_predefined_avatars_available";s:43:"There are no pre-defined avatars available.";s:18:"noparse_tag_allows";s:60:"The [noparse] tag allows you to stop the parsing of BB code.";s:10:"not_linked";s:10:"Not linked";s:30:"note_the_id_is_just_an_example";s:87:"(Note: The threadid/postid is just an example and may not link to a valid thread/post.)";s:16:"php_tag_performs";s:196:"The [php] tag performs the same function as the [code] tag, but also adds syntax highlighting for PHP code. Although it is designed for PHP, it may correctly highlight some other C-like languages.";s:12:"post_linking";s:12:"Post Linking";s:15:"post_tag_allows";s:128:"The [post] tag allows you to link to posts by specifying the post id. You can include an optional parameter to ''name'' your link.";s:6:"postid";s:6:"postid";s:16:"quote_tag_allows";s:61:"The [quote] tag allows you to attribute text to someone else.";s:17:"resulting_graphic";s:17:"Resulting Graphic";s:5:"right";s:5:"Right";s:10:"search_faq";s:10:"Search FAQ";s:9:"search_in";s:9:"Search In";s:22:"search_titles_and_text";s:39:"Search in both FAQ item titles and text";s:34:"search_titles_and_text_description";s:106:"Select this option if you would like your search to look in the text of FAQ items as well as their titles.";s:12:"search_words";s:20:"Search Word or Words";s:28:"show_only_items_that_contain";s:35:"Show only FAQ items that contain...";s:27:"showing_avatars_x_to_y_of_z";s:36:"Showing Avatars %1$s to %2$s of %3$s";s:17:"signature_picture";s:17:"Signature Picture";s:29:"signature_picture_description";s:40:"Signature Picture Description (optional)";s:17:"sigpic_tag_allows";s:186:"The [sigpic] tag allows you to insert your uploaded signature picture into your signature. This tag does not work in posts and will not work if you have not uploaded a signature picture.";s:4:"size";s:4:"Size";s:15:"size_tag_allows";s:58:"The [size] tag allows you to change the size of your text.";s:24:"smilies_are_small_images";s:655:"''Smilies'' are small graphical images that can be used to convey an emotion or feeling.\r\n		If you have used email or internet chat, you are likely familiar with the smilie concept.\r\n		Certain standard strings are automatically converted into smilies.\r\n		Try twisting your head on one side if you do not ''get'' smilies;\r\n		using a bit of imagination should reveal a face of some description.<br />\r\n		<br />\r\n		If you want to disable smilies in a post that you make, you can select the ''Disable Smilies'' option\r\n		when posting. This is particularly useful if you are posting program code and you do not\r\n		want <strong>;)</strong> converted to a smilie face!";s:19:"stop_bbcode_parsing";s:20:"Stop BB Code Parsing";s:33:"text_two_sizes_larger_than_normal";s:41:"this text is two sizes larger than normal";s:17:"this_text_is_blue";s:17:"this text is blue";s:17:"this_text_is_bold";s:17:"this text is bold";s:27:"this_text_is_center_aligned";s:27:"this text is center-aligned";s:25:"this_text_is_courier_font";s:32:"this text is in the courier font";s:24:"this_text_is_highlighted";s:24:"this text is highlighted";s:21:"this_text_is_indented";s:21:"this text is indented";s:19:"this_text_is_italic";s:19:"this text is italic";s:25:"this_text_is_left_aligned";s:25:"this text is left-aligned";s:26:"this_text_is_right_aligned";s:26:"this text is right-aligned";s:23:"this_text_is_underlined";s:23:"this text is underlined";s:14:"thread_linking";s:14:"Thread Linking";s:17:"thread_tag_allows";s:134:"The [thread] tag allows you to link to threads by specifying the thread id. You can include an optional parameter to ''name'' your link.";s:8:"threadid";s:8:"threadid";s:9:"underline";s:9:"Underline";s:16:"url_hyperlinking";s:16:"URL Hyperlinking";s:14:"url_tag_allows";s:120:"The [url] tag allows you to link to other websites and files. You can include an optional parameter to ''name'' your link.";s:5:"usage";s:5:"Usage";s:5:"value";s:5:"value";s:13:"vbulletin_faq";s:8:"%1$s FAQ";s:25:"vbulletin_faq_description";s:124:"Here you can find answers to questions about how the board works. Use the links or search box below to find your way around.";s:28:"vbulletin_forums_post_269302";s:18:"%1$s - Post 269302";s:29:"vbulletin_forums_thread_42918";s:19:"%1$s - Thread 42918";s:16:"video_tag_allows";s:89:"The [video] tag allows you to embed videos from various video services within your posts.";s:6:"videos";s:6:"Videos";s:12:"what_to_type";s:12:"What to Type";s:28:"x_requiring_at_least_y_posts";s:34:"%1$s Requiring at Least %2$s Posts";}', 'a:68:{s:27:"additional_facebook_options";s:27:"Additional Facebook Options";s:38:"additional_required_information_option";s:40:"Additional Required Information (option)";s:39:"additional_required_information_profile";s:41:"Additional Required Information (profile)";s:16:"already_a_member";s:17:"Already a member?";s:32:"are_you_sure_facebook_disconnect";s:82:"Are you sure you want to dis-connect this facebook account from your %1$s account?";s:33:"associate_facebook_with_x_account";s:119:"If you are already a member of %1$s, you can associate your facebook account with your %1$s account by logging in here.";s:21:"complete_registration";s:21:"Complete Registration";s:21:"confirm_email_address";s:21:"Confirm Email Address";s:27:"confirm_facebook_disconnect";s:27:"Confirm Facebook Disconnect";s:16:"confirm_password";s:16:"Confirm Password";s:24:"connect_facebook_account";s:68:"Do you want to connect this facebook account with your %1$s account?";s:27:"contact_webmaster_questions";s:66:"Please contact <a href="%1$s">the webmaster</a> with any questions";s:5:"coppa";s:5:"COPPA";s:11:"coppa_rules";s:11:"COPPA Rules";s:23:"coppa_rules_description";s:873:"<p><strong>COPPA Policy</strong></p>\r\n<p>All users under the age of 13 must seek permission from their parent or guardian\r\nin order to gain membership of the %1$s forums.\r\nWhile we welcome participation from members under 13,\r\nwe require that a parent or guardian fax or mail back a signed permission form before we grant membership.</p>\r\n\r\n<p>If you would like to start the registration process prior to us receiving a permission form,\r\ncheck the ''I agree'' checkbox and press the ''Register'' button below. If you would like to cancel the registration,\r\nclick <a href="%2$s">here</a> to return to the forums index.</p>\r\n\r\n<p>A copy of the permission form can be downloaded <a href="register.php?%3$sdo=coppaform">here</a>.</p>\r\n\r\n<p>For more information about the registration process, or the %1$s forums in general,\r\nplease send email to <a href="mailto:%4$s">%4$s</a>.</p>";s:24:"date_of_birth_is_binding";s:117:"The date of birth you enter here is binding and may not be altered at a later date. Make sure you enter it correctly!";s:25:"enter_valid_email_address";s:48:"Please enter a valid email address for yourself.";s:19:"enter_your_username";s:82:"Please enter the name by which you would like to log-in and be known on this site.";s:30:"entered_passwords_do_not_match";s:35:"The entered passwords do not match.";s:35:"errors_occurred_during_registration";s:54:"The following errors occurred during your registration";s:31:"facebook_already_associated_x_y";s:167:"Warning: This account is already associated with <a href="http://www.facebook.com/profile.php?id=%1$s">%2$s</a>. If you continue, this association will be overwritten.";s:21:"facebook_connect_at_x";s:29:"The Facebook Platform at %1$s";s:29:"fill_out_both_password_fields";s:37:"Please fill out both password fields.";s:11:"forum_rules";s:11:"Forum Rules";s:23:"forum_rules_description";s:620:"<b>\r\n<p></p>Welcome to PakGuns!<p></p>\r\n<p></p>\r\nPlease follow these simple common sense rules.<p></p>\r\n<p>\r\n1). No Profanity/Swearing or Illegal & Immature Discussions.</p><p>\r\n\r\n2). Stay on topic and don''t make useless posts or offensive comments.</p><p>\r\n\r\n3). Any post which is offensive to Pakistan will NOT be tolerated.</p><p>\r\n\r\n4). Religious / Political or Hate oriented Discussions are not allowed.</p><p>\r\n\r\n5). Torrents/Rapidshare links/pirated software etc are banned on PakGuns. </p><p>\r\n\r\n6). NO AUTO or ILLEGAL WEAPONS DISCUSSIONS ALLOWED !!</p><p></p><p>\r\n\r\nPlease be polite we all have guns ;) </p></b>";s:24:"forum_rules_registration";s:384:"<p><strong>Forum Rules</strong></p>\r\n\r\n<p>Registration to this forum is free! We do insist that you abide by the rules and policies detailed\r\nbelow. If you agree to the terms, please check the ''I agree'' checkbox and press the ''Complete Registration'' button below.\r\nIf you would like to cancel the registration, click <a href="%1$s.php%2$s">here</a>\r\nto return to the forums index.</p>";s:23:"fr_register_forum_rules";s:963:"<p><strong>Forum Rules</strong></p>\r\n\r\n<p>Registration to this forum is free! We do insist that you abide by the rules and policies detailed below. If you have read over and agree to the terms, please check the appropriate box in the app.</p>\r\n\r\n<p>Although the administrators and moderators of this forum will attempt to keep all objectionable messages off this forum, it is impossible for us to review all messages. All messages express the views of the author, and the owners of the forum will not be held responsible fo